// basically a selection sort
func sortAsc(inputs []int) []int {
	largest := 0
	largestIndex := 0
	sortedCount := 0

	for range inputs {
		for i := 0; i < len(inputs)-sortedCount; i++ {
			if inputs[i] >= largest {
				largest = inputs[i]
				largestIndex = i
			}
		}
		// swap to last sorted position
		lastIndex := len(inputs) - sortedCount - 1
		inputs[largestIndex] = inputs[lastIndex]
		inputs[lastIndex] = largest
		sortedCount++
		largest = 0
		largestIndex = 0
	}
	return inputs
}
